deck_description:
a really strong deck that can go first or second and can get up to 4 negates on field easily. It's one of the only decks that can use a full power halqifibrax combo due to the fact its a ritual/synchro deck and rarely uses the other link monsters because usually one turn is enough.

&nbsp;

*updated*

I don't want to get very deep in this deck strat because is more a test than a serious deck (since i ain't using handtraps), but the deck can be very good in a non-hand-trap match (this deck dies to any disruption).

&nbsp;

GLHF

Check out this awesome deck in action here: https://youtu.be/IgaMSejiCL0

Feel free to subscribe and like the video if you'd enjoy'd it &#x1f60e;

Any doubts or questions let me know &#x1f642;
